window.bookSummaryJSON = "<p>The fourth and final audiobook in Robert Kirkman's <i>New York Times</i> best-selling series, <i>The Walking Dead: Fall of the Governor, Part Two</i>! </p> <p>The Walking Dead series of original novels, set in the universe of Robert Kirkman's iconic comic, reaches its crescendo in <i>The Fall of the Governor, Part Two.</i> From coauthors Robert Kirkman, creator of the Eisner Award winning comic book and executive producer of AMC's blockbuster TV series, and Jay Bonansinga, Stoker award finalist and internationally acclaimed author, comes the gripping fourth and final novel in this richly woven literary saga, which began with <i>The Walking Dead: Rise of the Governor.</i> </p> <p>In <i>Rise of the Governor,</i> uber-villain Philip Blake journeyed from his humble beginnings directly into the dark heart of the zombie apocalypse, and became the self-proclaimed leader of a small town called Woodbury. In Book Two, <i>The Road to Woodbury,</i> an innocent traveler named Lilly Caul wound up in the terrifying thrall of Phillip Blake’s twisted, violent dictatorship within Woodbury’s ever tightening barricades. </p> <p>In <i>The Fall of the Governor, Part One,</i> classic characters from both the comic and television series, including Rick, Michonne and Glenn, finally made their appearance in the Walking Dead novel series, only to discover that the Governor is a very dangerous enemy. Now, after a pulse-pounding series of events, the Governor and Rick face off one last time, and only one of them will be left standing... </p>"; 
